  return (
    <div>
      <h1>{card.title}</h1>
      <p>{card.content}</p>
      <style jsx> {
        `
        div {
          width: 20rem;
          border-radius: 5px
        }
        `
      }

      </style>
    </div>
  )
}

export default FeaturedCard
